import React, { useContext } from 'react'
import { productsContext } from '../../App'

function SideBar() {
    const context = useContext(productsContext)

    const moneyData = [
        {
            id: 20,
            kdv: '0',
            price: '5',
            name: '5 TL',
            money: 5,
            src: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ3NJOeBxZFdnTdP1P2fxUWh9zxiqrcG-fXRA&usqp=CAU"
        },
        {
            id: 21,
            kdv: '0',
            price: '10',
            name: '10 TL',
            money: 10,
            src: "data:image/jpeg;base64,"
        },
        {
            id: 22,
            kdv: '0',
            price: '20',
            name: '20 TL',
            money: 20,
            src: "data:image/jpeg;base64,"
        },
        {
            id: 23,
            kdv: '0',
            price: '50',
            name: '50 TL',
            money: 50,
            src: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQt1pl0-exNGWc9Fu3Yh4xHmZcd3dhBbRpLrg&usqp=CAU"
        },
        {

            id: 24,
            kdv: '0',
            price: '100',
            name: '100 TL',
            money: 100,
            src: "data:image/jpeg;base64,"
        },
        {
            id: 25,
            kdv: '0',
            price: '200',
            name: '200 TL',
            money: 200,
            src: "data:image/jpeg;base64,"
        }
    ]

    return (
        <div className='flex flex-col p-5 items-center justify-center'>
            <h1 className='font-bold'>Uygulanacak Fiyat</h1>
            <select name="buy" className='border bg-yellow-100 w-32 outline-none'   >
                <option value="1">Normal Fiyat</option>
                <option value="2">İndirimli Fiyat</option>
            </select>
            <div className='flex flex-col justify-center items-center'>
                <label htmlFor="Money" className='font-bold '>Alınan Para</label>
                <input onChange={(event) => { context.remainingMoney(event.target.value) }} type="text" className='border border-blue-800 w-10/12' />
            </div>
            <div className='flex flex-col justify-center items-center mb-10'>
                <label htmlFor="change" className='font-bold '>Para Üstü</label>
                <input value={context.money} type="text" className='border border-blue-800 w-10/12' />
            </div>



            {
                moneyData.map((item, index) => {
                    return (
                        <div onClick={() => { context.addToCart(item) }} key={index} className={`${item.money} cursor-pointer my-3 ml-3 w-36`}>
                            <img className='' src={`${item.src}`} alt="" />

                        </div>
                    )
                })
            }

        </div>
    )
}

export default SideBar